import React, { Component } from "react";
import { FormattedMessage } from "react-intl";
import { connect } from "react-redux";
class HotpotRedux extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {}

  render() {
    return (
      <div className="hotpot-redux-container">
        <div className="title">HotpotRedux LINHHHHH</div>
        <div className="hotpot-redux-body">
          <div className="container">
            <div className="row">
              <div className="col-6">
                <label>Name</label>
                <input className="form-control" type="text" />
              </div>
              <div className="col-6">
                <label>Phone number</label>
                <input className="form-control" type="text" />
              </div>
              <div className="col-4">
                <label>ProvinceId</label>
                <select className="form-control">
                  <option selected>Choose...</option>
                  <option>...</option>
                </select>
              </div>
              <div className="col-4">
                <label>restaurantId</label>
                <input className="form-control" type="text" />
              </div>
              <div className="col-4">
                <label>typeId</label>
                <input className="form-control" type="text" />
              </div>
              <div className="col-6">
                <label>PriceId</label>
                <input className="form-control" type="text" />
              </div>
              <div className="col-6">
                <label>PaymentId</label>
                <select className="form-control">
                  <option selected>Choose...</option>
                  <option>...</option>
                </select>
              </div>
              <div className="col-6">
                <label>note</label>
                <input className="form-control" type="text" />
              </div>
            </div>
          </div>
        </div>
        ;
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {};
};

const mapDispatchToProps = (dispatch) => {
  return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(HotpotRedux);
